        const lines = csv.trim().split('\n');
        const headers = lines[0].split(',');
        const data = lines.slice(1).map(line => {
            const cols = line.match(/(".*?"|[^",\s]+)(?=\s*,|\s*$)/g).map(s => s.replace(/^"|"$/g, ''));
            return {
                fecha: cols[1],
                depto: cols[2],
                valor: parseFloat(cols[3])
            };
        });

        const fechas = [...new Set(data.map(d => d.fecha))].sort();
        const deptos = [...new Set(data.map(d => d.depto))];

        const series = deptos.map(depto => ({
            name: depto,
            data: fechas.map(fecha => {
                const found = data.find(d => d.fecha === fecha && d.depto === depto);
                return found ? found.valor : 0;
            }),
            stack: 'depto'
        }));

        Highcharts.chart('container', {
            chart: { type: 'area' },
            title: { text: 'Demanda sectorial de gas natural por departamento' },
            legend: {
            align: 'center',

            layout: 'horizontal'},

            xAxis: {

                title: { text: 'Fecha' },
                tickInterval: Math.ceil(fechas.length / 12),

            },

                style: { fontWeight: 'bold' },
            }},
            tooltip: {
                shared: true,
                valueDecimals: 0
            },
            plotOptions: {
                area: {
                    stacking: 'normal'
                }
            },
            series: series
        });
